textOriginal:
Escrevi dez motivos racionais porque eu nunca votaria em Bolsonaro:

1) incompetência de liderança desde o primeiro trimestre do governo, cedendo poderes ao legislativo (frouxo), troca-troca;

2) usou o poder do Estado para perseguir adversários políticos que ameaçariam sua reeleição, além de ser desleal a parceiros antigos (Magno Malta, amigo leal, Dória, juiz Witzel, Gustavo Bebiano e sua morte suspeita, Moro, Mandeta, etc) não precisa concordar com todos esses caras, mas isso são fatos;

3) usou o poder do estado para beneficiar amigos e familiares (implodiu a lava jato, acabou com o CAf, etc)! 

4) gestão na pandemia marcada por perversidade e e omissão...

5) conivente (no mínimo) com escândalos corrupção Educação e Saúde (ministros);

6) fez da gestão do orçamento público moeda de troca política -- jogou fora critérios de transparência e eficiência (gestão pública);

7) implodiu o sistema de proteção social! (Mudou nome de um programa que é de estado, e não de governo!);

8) desrespeito às leis fiscais (teto de gastos, etc) e eleitorais (mudança de leis para distribuir benesses perto da eleição para beneficiar campanha);

9) envolveu forças armadas ( que é do ESTADO) em questões político-partidárias (governo)

10) ameaças ao processo eleitoral vigente 

Bônus:

--- falta de decoro no exercício da presidência

--- usar o nome de Deus em vão... Não é cristão, mas encontrou um nicho para curral eleitoral. 

--- na política, não é liberal nem conservador. É + reacionário e disruptivo. 

--- Desrespeito ao equilíbrio entre os poderes 


Etc...
